import React, { Component } from "react";

import { connect } from "react-redux";
import { getAllUsers } from "../../actions/adminActions";
import { AuthTopBar, UserTable } from "../constants.js";

class AdminDashboard extends Component {
	constructor() {
		super();
		this.state = {
			users: []
		};
	}

	componentWillMount() {
		this.props.getAllUsers();
		this.setState({
			users: this.props.admin.users.data
		});
	}

	componentDidMount() {
		this.setState({
			users: this.props.admin.users.data
		});
	}

	render() {
		return (
			<div className="valign-wrapper">
				<AuthTopBar />
				<table style={{ width: "80%" }}>
					<thead>
						<tr>
							<th>Name</th>
							<th>Email</th>
							<th>Location</th>
							<th>Business</th>
						</tr>
					</thead>
					<tbody>
						{this.state.admin ? (
							this.state.users.map((items, id) => {
								return (
									<UserTable
										name={items.nam}
										email={items.email}
										location={"stuff"}
										business={"stuff"}
									/>
								);
							})
						) : (
							<tr>
								<td>Loading</td>
								<td>Loading</td>
								<td>Loading</td>
								<td>Loading</td>
							</tr>
						)}
					</tbody>
				</table>
			</div>
		);
	}
}

const mapStateToProps = state => ({
	admin: state.admin
});

export default connect(
	mapStateToProps,
	{ getAllUsers }
)(AdminDashboard);
